import FristSection from './FIRST_SECTION'
import SecSection from './SEC_SECTION'
class MainContent extends React.Component
{
    render()
    {
        return(
            <main>
                <div className="main_content">
        
                <FristSection />
                <SecSection />
                </div>



            </main>


        )
    }

}

export default MainContent;
